import styled from "styled-components";

const EventApplyContainer = styled.div`
  margin-top: 22.5rem;
  overflow-y: scroll;
`;
const EventApplyGNB = styled.div``;

const EventApplyForm = styled.form`
  height: calc(200vh - 68rem);
`;

const EventApplyInfo = styled.div`
  width: 100%;
  height: var(--mobile-screen);
  display: flex;
  flex-direction: column;
  align-items: center;
`;
const EventApplyIMG = styled.div``;
const EventApplyP = styled.p`
  width: 90%;
  font-size: 3.5rem;
  padding-top: 3rem;
`;

const EventApplyQ = styled.div`
  width: 100%;
  height: var(--mobile-screen);
`;
const EventApplyLabel = styled.label``;
const EventApplyInput = styled.input``;
const EventApplyBTN = styled.button``;

function EventApply() {
  return (
    <EventApplyContainer className="container">
      <EventApplyGNB className="gnb">이벤트 이름</EventApplyGNB>
      <EventApplyForm className="form">
        <EventApplyInfo>
          <EventApplyIMG className="mobile-img"></EventApplyIMG>
          <EventApplyP>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Itaque
            laudantium fugiat veniam earum iure consectetur accusamus sequi ut?
            Optio in, dolorum voluptate rem nihil aspernatur non obcaecati
            laudantium nemo a.
          </EventApplyP>
        </EventApplyInfo>
        <EventApplyQ>
          <EventApplyLabel className="label">
            참가 인원:
            <EventApplyInput className="input" type="number" />
          </EventApplyLabel>
          <EventApplyLabel className="label">
            참가자 전원 이름:
            <EventApplyInput className="input" type="text" />
          </EventApplyLabel>
          <EventApplyLabel className="label">
            모든 안내 사항을 확인하고 동의합니다.
            <EventApplyInput className="input" type="check" />
          </EventApplyLabel>
          <EventApplyBTN className="submit_btn">제출하기</EventApplyBTN>
        </EventApplyQ>
      </EventApplyForm>
    </EventApplyContainer>
  );
}

export default EventApply;
